import exampleresponse from "../exampleresponse.json";
import Video from "./Video";
function VideosList() {
  const videosList = exampleresponse;
  const rows = [];

  for (let i = 0; i < videosList.length; i += 3) {
    const rowVideos = videosList.slice(i, i + 3);
    rows.push(
      <div className="row" key={`row-${i}`}>
        {rowVideos.map((video) => (
          <div className="col-md-4" key={video.id}>
            <Video videoObj={video} />
          </div>

        ))}

      </div>
    );
  }

  return <div className="container mt-5">{rows}</div>;
}

export default VideosList;
